import binascii

def decode_frequency_vector(data_string):
    # Define constants for offsets and lengths
    FREQ_OFFSET = 8
    FREQ_LENGTH = 2
    EPP_OFFSET = 26
    EPP_LENGTH = 2
    PERFBIAS_OFFSET = 52
    PERFBIAS_LENGTH = 2

    # Convert the hex string to bytes
    data_bytes = binascii.unhexlify(data_string)

    # Extract frequency information
    freq_hex = data_bytes[FREQ_OFFSET:FREQ_OFFSET + FREQ_LENGTH].hex()
    freq = int(freq_hex, 16)

    # Extract EPP information if present
    epp_hex = data_bytes[EPP_OFFSET:EPP_OFFSET + EPP_LENGTH].hex()
    epp = int(epp_hex, 16) if epp_hex else None

    # Extract Performance Bias information if present
    perfbias_hex = data_bytes[PERFBIAS_OFFSET:PERFBIAS_OFFSET + PERFBIAS_LENGTH].hex()
    perfbias = int(perfbias_hex, 16) if perfbias_hex else None

    # Create a dictionary with the extracted information
    result = {"Frequency": freq}
    if epp is not None:
        result["EPP"] = epp
    if perfbias is not None:
        result["Performance_Bias"] = perfbias

    return result

